import React from 'react';
import Bot from './Bot'; // Import the Bot component

const YourBotArmy = ({ enlistedBots, onDelete }) => {
  return (
    <div className="your-bot-army">
      <h2>Your Bot Army</h2>
      {enlistedBots.map((bot) => (
        <Bot key={bot.id} bot={bot} onDelete={onDelete} /> // Use the Bot component to display each enlisted bot
      ))}
    </div>
  );
};

export default YourBotArmy;
